import React, { useState, useEffect } from 'react';
import {
  Box,
  Paper,
  IconButton,
  Typography,
  List,
  ListItem,
  ListItemText,
  ListItemSecondaryAction,
  Tooltip,
  Select,
  MenuItem,
  Button,
  Chip,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  FormControl,
  InputLabel,
  Collapse,
  CircularProgress,
  Divider,
} from '@mui/material';
import {
  DragHandle as DragIcon,
  PlayArrow as PlayIcon,
  Delete as DeleteIcon,
  Send as SendIcon,
  Add as AddIcon,
  Settings as SettingsIcon,
  Info as InfoIcon,
  ExpandMore as ExpandMoreIcon,
  ExpandLess as ExpandLessIcon,
  MenuBook as NotebookIcon,
  Download as DownloadIcon,
} from '@mui/icons-material';
import { processWithAssistant, generateSummary } from '../utils/brainstormUtils';

// Model configuration presets
const MODEL_PRESETS = {
  creative: {
    name: "Creative",
    config: {
      temperature: 0.9,
      max_tokens: 2000,
      top_p: 0.95,
      frequency_penalty: 0.5,
      presence_penalty: 0.5
    }
  },
  balanced: {
    name: "Balanced",
    config: {
      temperature: 0.7,
      max_tokens: 2000,
      top_p: 0.9,
      frequency_penalty: 0.2,
      presence_penalty: 0.2
    }
  },
  precise: {
    name: "Precise",
    config: {
      temperature: 0.3,
      max_tokens: 2000,
      top_p: 0.8,
      frequency_penalty: 0,
      presence_penalty: 0
    }
  }
};

const BrainstormControl = ({ panels, onSubmitToPanels, currentMessage, onToggleNotebook, models }) => {
  const [sequence, setSequence] = useState([]);
  const [selectedOutputPanel, setSelectedOutputPanel] = useState('');
  const [isProcessing, setIsProcessing] = useState(false);
  const [results, setResults] = useState(null);
  const [modelSettingsOpen, setModelSettingsOpen] = useState(false);
  const [selectedPanelForSettings, setSelectedPanelForSettings] = useState(null);
  const [isExpanded, setIsExpanded] = useState(false);
  const [currentProcessingIndex, setCurrentProcessingIndex] = useState(-1);

  // Process message through the sequence when currentMessage changes
  useEffect(() => {
    const processBrainstorm = async () => {
      if (!currentMessage || sequence.length === 0 || isProcessing) return;
      
      setIsProcessing(true);
      setResults(null);
      
      try {
        const results = [];
        // Process through each assistant in sequence
        for (let i = 0; i < sequence.length; i++) {
          const item = sequence[i];
          setCurrentProcessingIndex(i);
          
          // Get previous response if available
          const previousResponse = i > 0 ? results[i - 1].response.response : currentMessage;
          
          // Process with current assistant
          const response = await processWithAssistant(
            item.panelId, 
            previousResponse,
            item.modelId,
            item.config
          );
          
          results.push({
            panelId: item.panelId,
            modelId: item.modelId,
            response
          });

          // Submit intermediate results to panel
          onSubmitToPanels(item.panelId, response.response);
        }

        // If output panel is selected, generate final summary
        if (selectedOutputPanel && results.length > 0) {
          const summaryPrompt = `Please analyze the following conversation and create a comprehensive summary that includes:
1. Key points and decisions
2. Different perspectives offered
3. Final conclusions or recommendations

Conversation:
${results.map((r, i) => `Assistant ${i + 1} (${r.modelId}):
${r.response.response}
---
`).join('\n')}`;

          const summary = await processWithAssistant(
            selectedOutputPanel,
            summaryPrompt,
            models[0]?.id
          );

          // Add summary to results
          results.push({
            panelId: selectedOutputPanel,
            modelId: models[0]?.id,
            response: summary,
            isSummary: true
          });

          // Submit summary to panel
          onSubmitToPanels(selectedOutputPanel, summary.response);
        }
        
        setResults(results);
        
        // Save brainstorm session
        const timestamp = new Date().toISOString();
        const sessionData = {
          id: `brainstorm-${timestamp}`,
          timestamp,
          originalMessage: currentMessage,
          sequence: sequence.map(item => ({
            assistant: getAssistantName(item.panelId),
            model: item.modelId
          })),
          results: results.map(r => ({
            assistant: getAssistantName(r.panelId),
            model: r.modelId,
            response: r.response.response,
            isSummary: r.isSummary
          }))
        };

        // Save to localStorage
        const savedSessions = JSON.parse(localStorage.getItem('brainstorm-sessions') || '[]');
        savedSessions.push(sessionData);
        localStorage.setItem('brainstorm-sessions', JSON.stringify(savedSessions));

      } catch (error) {
        console.error('Brainstorm error:', error);
      } finally {
        setIsProcessing(false);
        setCurrentProcessingIndex(-1);
      }
    };

    processBrainstorm();
  }, [currentMessage, sequence, selectedOutputPanel, models, isProcessing, onSubmitToPanels]);

  // Add a panel to the sequence with default preset
  const handleAddToSequence = (panelId) => {
    const panel = panels.find(p => p.id === panelId);
    if (!panel) return;

    setSequence(prev => [...prev, {
      id: `seq-${Date.now()}`,
      panelId,
      modelId: panel.selectedModel || models[0]?.id || 'default',
      preset: 'balanced',
      config: { ...MODEL_PRESETS.balanced.config }
    }]);
  };

  // Helper function to get assistant name from panel
  const getAssistantName = (panelId) => {
    const panel = panels.find(p => p.id === panelId);
    return panel?.assistantName || `Assistant ${panels.findIndex(p => p.id === panelId) + 1}`;
  };

  // Display current configuration
  const renderConfigInfo = (item) => {
    const preset = item.preset || 'balanced';
    return (
      <Box sx={{ display: 'flex', alignItems: 'center', ml: 1 }}>
        <Tooltip title={
          <Box>
            <Typography variant="body2">Preset: {MODEL_PRESETS[preset].name}</Typography>
          </Box>
        }>
          <IconButton size="medium" color="primary">
            <InfoIcon />
          </IconButton>
        </Tooltip>
      </Box>
    );
  };

  // Remove a panel from the sequence
  const handleRemoveFromSequence = (sequenceId) => {
    setSequence(prev => prev.filter(item => item.id !== sequenceId));
  };

  // Open model settings dialog
  const handleOpenModelSettings = (sequenceItem) => {
    // Find the panel's current model
    const panel = panels.find(p => p.id === sequenceItem.panelId);
    
    // Update the sequence item to use the panel's selected model if it exists
    const updatedItem = {
      ...sequenceItem,
      modelId: panel?.selectedModel || sequenceItem.modelId
    };
    
    setSelectedPanelForSettings(updatedItem);
    setModelSettingsOpen(true);
  };

  // Update model for a panel
  const handleModelChange = (modelId) => {
    if (!selectedPanelForSettings) return;
    
    setSequence(prev => prev.map(item => 
      item.id === selectedPanelForSettings.id
        ? { ...item, modelId }
        : item
    ));
    setModelSettingsOpen(false);
  };

  const handleDownloadReport = () => {
    if (!results) return;

    const formatTimestamp = (date) => {
      return new Date(date).toLocaleString();
    };

    const formatEntry = (entry, index) => {
      return `Assistant ${index + 1} Response:
Model: ${entry.modelId}
${entry.response}
-------------------
`;
    };

    const report = `AI Brainstorm Report
Generated: ${formatTimestamp(new Date())}
===================

Original Message:
${currentMessage}

Processing Sequence:
${sequence.map((item, index) => `${index + 1}. ${getAssistantName(item.panelId)} (${item.modelId})`).join('\n')}

Results:
${results.map((entry, index) => formatEntry(entry, index)).join('\n')}

Summary:
${results.reduce((acc, entry) => {
  const key = entry.panelId;
  acc[key] = entry.response;
  return acc;
}, {})}
`;

    const blob = new Blob([report], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `brainstorm-report-${new Date().toISOString()}.txt`;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  return (
    <Box sx={{ position: 'relative', mb: isExpanded ? 2 : 0 }}>
      <Paper sx={{ 
        p: isExpanded ? 2 : 1,
        m: 2,
        minHeight: isExpanded ? 'auto' : '48px'
      }}>
        <Box sx={{ 
          display: 'flex', 
          justifyContent: 'space-between', 
          alignItems: 'center',
          mb: isExpanded ? 2 : 0
        }}>
          <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
            <Typography variant="h6" sx={{ fontSize: isExpanded ? '1.25rem' : '1rem' }}>
              AI Brainstorm Control
            </Typography>
            {isProcessing && (
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <CircularProgress size={20} />
                <Typography variant="body2" color="text.secondary">
                  Processing with Assistant {currentProcessingIndex + 1}
                </Typography>
              </Box>
            )}
          </Box>
          <Box sx={{ display: 'flex', gap: 1 }}>
            {results && (
              <Tooltip title="Download Report">
                <IconButton 
                  onClick={handleDownloadReport}
                  color="primary"
                >
                  <DownloadIcon />
                </IconButton>
              </Tooltip>
            )}
            <Tooltip title="Open Notebook">
              <IconButton 
                onClick={onToggleNotebook}
                color="primary"
              >
                <NotebookIcon />
              </IconButton>
            </Tooltip>
            <Tooltip title={isExpanded ? "Collapse" : "Expand"}>
              <IconButton onClick={() => setIsExpanded(prev => !prev)}>
                {isExpanded ? <ExpandLessIcon /> : <ExpandMoreIcon />}
              </IconButton>
            </Tooltip>
          </Box>
        </Box>

        <Collapse in={isExpanded} timeout="auto">
          {/* Sequence Builder */}
          <Box sx={{ mb: 2 }}>
            <Typography variant="subtitle1" gutterBottom>
              Processing Sequence
            </Typography>
            <List>
              {sequence.map((item, index) => (
                <ListItem
                  key={item.id}
                  sx={{ 
                    bgcolor: 'background.paper', 
                    mb: 1,
                    borderRadius: 1,
                    border: '1px solid',
                    borderColor: 'divider',
                    '&:hover': {
                      bgcolor: 'action.hover',
                    }
                  }}
                >
                  <DragIcon sx={{ mr: 1, color: 'action.active' }} />
                  <ListItemText 
                    primary={
                      <Box sx={{ display: 'flex', alignItems: 'center' }}>
                        <Typography variant="subtitle2">
                          {getAssistantName(item.panelId)}
                        </Typography>
                        {renderConfigInfo(item)}
                      </Box>
                    }
                    secondary={`Model: ${item.modelId} - ${MODEL_PRESETS[item.preset || 'balanced'].name}`}
                  />
                  <ListItemSecondaryAction sx={{ display: 'flex', gap: 1 }}>
                    <Tooltip title="Model Settings">
                      <IconButton 
                        onClick={(e) => { e.stopPropagation(); handleOpenModelSettings(item); }}
                        color="primary"
                        size="medium"
                      >
                        <SettingsIcon />
                      </IconButton>
                    </Tooltip>
                    <Tooltip title="Remove Panel">
                      <IconButton 
                        onClick={(e) => { e.stopPropagation(); handleRemoveFromSequence(item.id); }}
                        color="error"
                        size="medium"
                      >
                        <DeleteIcon />
                      </IconButton>
                    </Tooltip>
                  </ListItemSecondaryAction>
                </ListItem>
              ))}
            </List>

            {/* Add Panel to Sequence */}
            <Box sx={{ mt: 2 }}>
              {panels.map((panel) => (
                <Tooltip key={panel.id} title="Add to sequence">
                  <Chip
                    label={getAssistantName(panel.id)}
                    onClick={(e) => { e.stopPropagation(); handleAddToSequence(panel.id); }}
                    icon={<AddIcon />}
                    sx={{ mr: 1 }}
                    color="primary"
                    variant="outlined"
                  />
                </Tooltip>
              ))}
            </Box>
          </Box>
          
          {/* Output Panel Selector */}
          <Box sx={{ mb: 2 }}>
            <Typography variant="subtitle1" gutterBottom>
              Summary Assistant
            </Typography>
            <Typography variant="body2" color="text.secondary" gutterBottom>
              Select an assistant to generate the final summary and report
            </Typography>
            <Select
              value={selectedOutputPanel}
              onChange={(e) => setSelectedOutputPanel(e.target.value)}
              fullWidth
              size="small"
            >
              <MenuItem value="">
                <em>None</em>
              </MenuItem>
              {panels.map((panel) => (
                <MenuItem key={panel.id} value={panel.id}>
                  {getAssistantName(panel.id)}
                </MenuItem>
              ))}
            </Select>
          </Box>
          
          {/* Results Display */}
          {results && (
            <Box sx={{ mt: 2 }}>
              <Typography variant="subtitle1" gutterBottom>
                Results
              </Typography>
              <Paper variant="outlined" sx={{ p: 2 }}>
                {results.map((result, index) => (
                  <Box key={index} sx={{ mb: 2 }}>
                    <Typography variant="subtitle2" color="primary" gutterBottom>
                      {result.isSummary ? 'Final Summary' : `${getAssistantName(result.panelId)} (${result.modelId})`}
                    </Typography>
                    <Typography variant="body2" sx={{ whiteSpace: 'pre-wrap' }}>
                      {result.response}
                    </Typography>
                    {index < results.length - 1 && (
                      <Divider sx={{ my: 2 }} />
                    )}
                  </Box>
                ))}
              </Paper>
            </Box>
          )}
        </Collapse>

        {/* Model Settings Dialog */}
        <Dialog 
          open={modelSettingsOpen} 
          onClose={() => setModelSettingsOpen(false)}
          maxWidth="sm"
          fullWidth
        >
          <DialogTitle>
            Model Settings for {selectedPanelForSettings ? 
              getAssistantName(selectedPanelForSettings.panelId) : 
              ''}
          </DialogTitle>
          <DialogContent>
            <FormControl fullWidth sx={{ mt: 2 }}>
              <InputLabel>Model</InputLabel>
              <Tooltip title={
                <Box>
                  <Typography variant="body2">Available Models:</Typography>
                  <ul style={{ margin: '8px 0', paddingLeft: '20px' }}>
                    {models.map(model => (
                      <li key={model.id}>{model.name}</li>
                    ))}
                  </ul>
                  <Typography variant="body2">
                    These are the same models available in your chat assistants.
                    Each model has different capabilities and characteristics:
                  </Typography>
                  <ul style={{ margin: '8px 0', paddingLeft: '20px' }}>
                    <li>Hermes/Nous: Good for general tasks and coding</li>
                    <li>Gemma: Efficient for shorter responses</li>
                    <li>Mixtral/Mistral: Strong reasoning and analysis</li>
                    <li>Neural/Code-Llama: Specialized for code generation</li>
                  </ul>
                </Box>
              } placement="right">
                <Select
                  value={selectedPanelForSettings?.modelId || ''}
                  onChange={(e) => handleModelChange(e.target.value)}
                  label="Model"
                >
                  {models.map((model) => (
                    <MenuItem key={model.id} value={model.id}>
                      {model.name}
                    </MenuItem>
                  ))}
                </Select>
              </Tooltip>
            </FormControl>
          </DialogContent>
          <DialogActions>
            <Button onClick={() => setModelSettingsOpen(false)}>Cancel</Button>
          </DialogActions>
        </Dialog>
      </Paper>
    </Box>
  );
};

export default React.memo(BrainstormControl);
